:\"3f3e89ed-79b5-4fef-b9ba-37f980a1fda3\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.0962111653492037,\"y\":0,\"width\":55.906769432809384,\"height\":10.617474021094935,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h2>II-Respiratory organs</h2>\\n\"},\"subContentId\":\"e0726429-fdb4-4523-9b20-2db367e0b54d\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0962111653492037,\"y\":8.650612688575778,\"width\":64.67645875560301,\"height\":8.661439487935697,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3>1-In Terrestrial Animals</h3>\\n\"},\"subContentId\":\"332651e0-987b-4979-add3-6732bbc76f4e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0962111653492035,\"y\":17.322878975871394,\"width\":98.65900488142832,\"height\":6.192929233874024,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Animals that live on land have specific organs that allow them to renew the air in their organisms. These organs are:</p>\\n\"},\"subContentId\":\"bd0c50a0-7680-4169-af28-e1df96c86d7f\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":38.126361655773,\"y\":40.860215053763,\"width\":61.655773420479,\"height\":32.688172043011,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Inhaled air enters the mouth (or nose), passes through the trachea that divides into 2 bronchi. Air enters each lung through the bronchus which in turn divides into many bronchioles. Air arrives at the extremities of the bronchioles where tiny sacs are located: the alveoli.</p>\\n\\n<p>Exhaled air follows the opposite direction.</p>\\n\"},\"subContentId\":\"bc310b3a-3d80-4d95-80e9-adac70b4c0a5\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":37.991572327044,\"y\":32.209701492537,\"width\":43.823899371069,\"height\":6.318407960199,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#000080\\\"><strong>Lungs</strong></span><span style=\\\"color:#0000CD\\\"><strong> </strong></span>for mammals (humans for example).</p>\\n\"},\"subContentId\":\"b14c9cb6-5caf-46aa-a8a9-d23f3168a782\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":0,\"y\":30.534351145038,\"width\":33.298969072165,\"height\":47.93893129771,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4RXYRXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAA a-4f86bbc41b5d\",\"metadata\":{\"license\":\"U\",\"contentType\":\"Image\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0962111653492035,\"y\":61.06314838994667,\"width\":42.3283305909784,\"height\":38.976477695710635,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>In fish, water circulates through specialized organs called gills. The fish mouth opens to let <strong>oxygen </strong>rich water in. Then the mouth closes and the opercula open to let water enriched with <strong>carbon dioxide</strong> out.</p>\\n\"},\"subContentId\":\"04184697-a088-4a74-8811-2de30c8811bd\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":47.13708011001575,\"y\":10.826799359919622,\"width\":52.406238318499774,\"height\":19.488238847855317,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Fish have a gill chamber on each side of the head. Each gill chamber contains 4 gills. Each gill consists of 2 layers of gill filaments fixed on a bony arc.</p>\\n\"},\"subContentId\":\"bb0a515f-cf9d-4b05-8bbe-0203b195e745\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":49.32950244071416,\"y\":82.28367513538912,\"width\":49.38244944000053,\"height\":15.929838009427977,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Respiratory gas exc ,\"height\":183,\"copyright\":{\"license\":\"U\"}},\"alt\":\"Frog\",\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"subContentId\":\"2f5e739f-1fb3-4c63-88a8-c6cef0f9986d\",\"metadata\":{\"license\":\"U\",\"contentType\":\"Image\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":32.54837305819895,\"y\":28.561096711467965,\"width\":63.580247590253805,\"height\":28.149678335791016,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Frogs live at the same time in water and on land. When on land, frogs respire through their lungs. When in water, they respire only through their skin (cutaneous respiration).</p>\\n\"},\"subContentId\":\"311de07d-8f22-4188-970a-a71c72b19e22\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0962111653492035,\"y\":4.330719743967848,\"width\":23.206751175407,\"height\":7.9761907142857,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#0000CD\\\"><strong>Skin and Lungs</strong></span> for frogs.</p>\\n\"},\"subContentId\":\"a2d419b8-c913-4885-9895-bf91ea36cbab\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.0962111653492035,\"y\":0,\"width\":45.68868980963,\"height\":8.4070796460177,\"action\ ome microscopic living things, like yeasts, are capable of living in the absence of oxygen.</p>\\n\"},\"subContentId\":\"1e1af692-1f0b-44d8-b4bb-c9f7e746b706\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":28.570880465845892,\"y\":24.995398610272034,\"width\":71.13127896052873,\"height\":41.14183756769456,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Yeasts are unicellular fungi.</p>\\n\\n<p>In aerobic conditions (in the presence of oxygen), yeasts respire like any living thing, that is they take in oxygen and reject carbon dioxide.</p>\\n\\n<p>In anaerobic conditions (in the absence of oxygen), yeasts carry out fermentation during which they use the sugar in the medium and produce alcohol and carbon dioxide.</p>\\n\"},\"subContentId\":\"1467c266-89b8-4995-a7dd-e079be38529c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":31.590413943355,\"y\":0,\"width\":16.557734204793,\"height\":8.1720430107527,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3>Concept Map</h3>\\n\"},\"subContentId\":\"c24ef306-3f1d-47a7-92c2-3a3be8b7e35a\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":87.145969498911,\"y\":86.666666666667,\"width\":
